TankFest - Essential Showguide 2014
The Tank Museum | 2014 | ISBN: N/A | English | 32 pages | PDF | 44.2 MB

The World's best display of moving armour, the best display of historic moving armour in the world at The Tank Museum bringing the story of tanks, tank crew and soldiers to life. Historic vehicle displays include vehicles making their show debuts, with a number of old favourites returning to the arena.
